import React, {Component} from 'react'
import './App.css';
import background from './background.png';

var sectionStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: "url(" + { background } + ")"
};

class App extends Component {

  render () {
    return (
      <div className="App">
        <section style={sectionStyle}>
        <h1> Aliens CRUD </h1>
        </section>

      </div>
    );
  }
}

export default App;
